import logo from './logo.svg';
import { useFetchWrapper } from "./_helpers";

function Profile() {
  const fetchWrapper = useFetchWrapper();
  const [loaded, finishedLoading] = useState(false);
  const [id, setId] = useState(useParams());
  if(!id){
      id = fetchWrapper.get("http://127.0.0.1:80/current-user")
  }
  const item = fetchWrapper.get("api.instaswatch.com/profile");
    return (
        <div class="center">
            <div class="pad">
            <div class="profile">
                <div id = "profile-pic"></div>
                <img src ={item.picture}></img>
                <div id = "profile-username"></div>
                {item.username}
                <div id = "profile-displayname"></div>
                {item.displayName}
                <div id = "profile-bio"></div>
                {item.bio}
                <div id = "profile-followers"></div>
                <a href = {"/profile/" + item.username + "/followers"}></a>
                <div id = "profile-following"></div>
                <a href = {item.username + "/following"}></a>
            </div>
            <div class="profile-posts">
                <div class="feed">

                </div>
            </div>
        </div>
        </div>
        );
  }

export default Profile;
